import React from "react";
import PropTypes from "prop-types";
import { Menu } from "antd";
import { Link } from "react-router-dom";
import "./MainMenu.css";
const MainMenu = (props) => {
    return (
        <Menu
            defaultSelectedKeys={"/pocetnaStranaDonatora", "/pocetnaStranaKorisnika"}
            theme="light"
            mode="horizontal"
        >
                <>
                    <Menu.Item key={"/dodajOglas"}>
                        <Link to={"/dodajOglas"}>{"Dodaj oglas"}</Link>
                    </Menu.Item>
                    <Menu.Item key={"/oglasi"}>
                        <Link to={"/oglasi"}>{"Oglasi"}</Link>
                    </Menu.Item>
                    <Menu.Item key={"/upravljanjeNalozima"}>
                        <Link to={"/upravljanjeNalozima"}>{"Nalozi"}</Link>
                    </Menu.Item>
                    <Menu.Item key={"/mojProfil"}>
                        <Link to={"/mojProfil"}>{"Moj profil"}</Link>
                    </Menu.Item>
                </>
        </Menu>
    );
};

MainMenu.propTypes = {
    location: PropTypes.object,
    role: PropTypes.string,
};

export default MainMenu;
